import React from "react";
import ReactDOM from "react-dom";

function Product(props) {
  return (
    <div classname="product">
      <h1 style={{ display: props.question ? "block" : "none" }}>
        Question: {props.question}
      </h1>
      <p>{props.punchLine}</p>
    </div>
  );
}

export default Product;
